import { Box, Grid, Link, Typography, Toolbar, AppBar, IconButton } from '@mui/material';
import Logo from '../assets/Logo.png';
import React from 'react';
import '../styles/Navbar.css';
import { motion } from 'framer-motion';

function Navbar() {
  return (
    <div>
        {/* style={{ backgroundColor: 'transparent', boxShadow: 'none', borderRadius: '15px', margin: '30px', width: '50%', marginLeft: '25%', marginRight: '25%' }} */}
        <AppBar className="navbar" position="fixed"  >
            <Toolbar style={{ minHeight: '50px' }}>
                <IconButton className="logo" edge="start" color="inherit" aria-label="menu">
                    <Link to="/"><img src={Logo} alt='Logo' /></Link>
                </IconButton>
                <Typography variant="h6">
                    <motion.div
                        initial={{ opacity: 0 }}
                        animate={{ opacity: 1 }}
                        transition={{ duration: 1 }}
                    >
                        <Link to="/">Home</Link>
                    </motion.div>
                </Typography>

                <Typography variant="h6">
                    <motion.div
                        initial={{ opacity: 0 }}
                        animate={{ opacity: 1 }}
                        transition={{ duration: 1 }}
                    >
                        <Link to="/">Portfolio</Link>
                    </motion.div>
                </Typography>

                <Typography variant="h6">
                    <motion.div
                        initial={{ opacity: 0 }}
                        animate={{ opacity: 1 }}
                        transition={{ duration: 1 }}
                    >
                        About
                    </motion.div>
                </Typography>
            </Toolbar>
        </AppBar>
    </div>
  )
}

export default Navbar
